import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
 const mapRoutes = {
    "clue1" : <Clue1 /> ,
    "jiya": <Person1 />,

    "clue2" : <Clue2 />, 
    "saloni": <Person2 />,

    "clue3" : <Clue3 />, 
    "krish": <Person3 />, 

    "clue4" : <Clue4 />,
    "dhara": <Person4 />, 

    "clue5" : <Clue5 />, 
    "sarjana": <Person5 />, 

    "clue6" : [<Clue6 />, "person6"],
    "viha": [<Person6 />, "clue7"],

    "clue7" : <Clue7 />, 
    "riza": <Person7 />, 

    "clue8" : <Clue8 />, 
  }

  const routeList = [];

  routeList.push(
    <Route path="/" element={<Home />} />
  )
  let str = "/"
  Object.entries(mapRoutes).forEach(([clueName, listDetais], index) => {
    str += clueName + '/'
    routeList.push(
      <Route path={str} element={listDetais[0]} />
    )
  });
function App() {
  return (
      <BrowserRouter>
      <Routes>
        {routeList}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
